import React from "react";
import styled from "styled-components";
import { RiLock2Fill } from "react-icons/ri";

const LoginPage = () => {
  let clientScreenHeight = document.documentElement.clientHeight;

  let LoginHead = styled("p")`
    font-size: 48px;
    width: 300px;
    border-bottom: 2px solid #2d4059;
  `;

  let Label = styled("span")`
    font-size: 32px;
    margin-right: 50px;
  `;

  return (
    <div>
      <div className="container">
        <div className="row">
          <div
            className="col d-flex flex-column justify-content-center align-items-center"
            style={{ height: clientScreenHeight }}
          >
            <LoginHead>Login</LoginHead>
            <p>
              <RiLock2Fill style={{ fontSize: "48px" }} />
            </p>
            <p style={{ display: "flex" }}>
              <Label>ID</Label>
              <input type="text" placeholder="아이디를 입력하세요" />
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
